Currently all of the guides are broken because they rely on an externally hosted Javascript file that contains the code that converts markdown to HTML. Instead, I've included that file in the template_assets folder and changed all of the guides to use it.

Also some minor styling fixes for the left-side nav are included.

@soapdog Review?

Will create a regions.js module that returns something like:

```
{'de': gettext('Germany'), 'fr': gettext('France')}
```

Will create a regions.styl module that looks like:

```
$regions = de fr;
for $region in $regions
    .region-{region} {
        background-image: url('../img/icons/regions/{region}.png');
    }
```

Then sets the dist/img/regions directory to only contain region flag images for supported regions.

pullcommitmsg:
More generic layout for caching.

- new $wgBugzillaCacheType, replaces $wgBugzillaUseCache and $wgCacheObject
  with mysql, apc, memcache, postgresql, sqlite, dummy types;
- new Bugzilla::getCacheClass() and ::getCache() static methods;
- new BugzillaCacheI::setup() abstract method, called by BugzillaCreateCache();
- new BugzillaCacheSql class, handling any generic MW SQL-backend;
  BugzillaCacheMysql is dropped;
- separate SQL CREATE TABLE definitions for MySQL, PostgreSQL and SQLite;
- base64_encode/decode cached values, fixes SQL escaping issues;
- drop cache db fetched_at column.

pull_msg:
`$options` is manipulated several times in the query class and sub-classes: injecting synthetic fields before querying cache/web service, making sure it is set, etc. This makes several unnecessary duplicates and shows uncertainty about how `$options` should look like.

This PR introduces, in order of impact:
- new `prepare_options()`, that's used to initialize the `$options`; later methods don't have to guess anymore; this should fix #18 as well;
- new `rebase_fields()` which replaces most duplicated code with a single, easier to read function;
- new `rebased_options()` which returns `$options` content + specific arrangements for HTTP queries;
- tests for above methods;
- when no JSON configuration is provided in the `<bugzilla>` element, a default working configuration is used, instead of triggering an error.

I am not so sure about:
- the naming of the methods introduced: `prepare_options`, `rebase_fields`, `rebased_options`;
- I moved `fetch()` out of the constructors to help testing objects behavior. It's now triggered through `BugzillaOutput`;
- the exact default failover configuration: I think it's good to set a working default but maybe the default query could be more specific than this one.

